import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and perform search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for products to load
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Rapid cart manipulation - add multiple items quickly
    const addToCartButtons = await page.$$('.add-to-cart');
    const cartOperations = [];

    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      cartOperations.push(`Added product ${i + 1} to cart`);
      await page.waitForTimeout(100); // Small delay between operations
    }

    // Verify cart count updated
    const cartCount = await page.$eval('.cart', el => {
      const text = el.textContent;
      const match = text.match(/\d+/);
      return match ? parseInt(match[0]) : 0;
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_updated.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modal.png'));

    // Remove items from cart rapidly
    const removeButtons = await page.$$('.remove-item');
    for (const button of removeButtons) {
      await button.click();
      await page.waitForTimeout(100); // Small delay between removals
    }

    // Verify empty cart
    const emptyCart = await page.$('.empty-cart');
    const isCartEmpty = emptyCart !== null;

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_empty_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_empty_cart.png'));

    // Close cart modal
    await page.click('.close');
    await page.waitForTimeout(500);

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test",
      extractedData: {
        initialCartCount: 0,
        finalCartCount: cartCount,
        operationsPerformed: cartOperations,
        isCartEmpty: isCartEmpty
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
